function sketch (p) {
  var rotation = 0;

  p.setup = function () {
    p.createCanvas(200, 200, p.WEBGL);
  };


  p.draw = function () {
    rotation += 0.01;
    p.background(100);
    p.noStroke();
    p.push();

    p.rotateY(rotation);
    p.box(100);
    p.pop();
  };
};

